import Item from '../dataTypes/item';

const imageUrl = "./images/helados/";

const helados: Item[] = [
/*          id|title        | description             price|url| stock*/
  new Item(1,'Chocolate'     , 'Un sabor clásico como nunca lo habías visto!' ,20  ,imageUrl + '/Paletas/chocolate.jpg', 2),
  new Item(2,'Menta'         , 'Amado y odiado por muchos'      ,10   ,'./default.png', 3),
  new Item(3,'Frambuesa'     , 'Un sabor que no puede faltar en tu helado'      ,3   ,'./default.png', 4),
  new Item(4,'Lemon Pie'     , 'Solo para clientes de culto'      ,5   ,'./default.png', 5),
  new Item(5,'Maracuyá'      , 'O melhor sorvete do Brasil'      ,7   ,'./default.png', 6),
  new Item(6,'Frutilla'      , 'Tu fruta favorita en forma de helado'      ,16  ,'./default.png', 7),
  new Item(7,'Limón'         , 'Ácido pero plácido!'      ,4   ,'./default.png', 9),
];

const obtenerHelados = (): Item[] => helados;

export {obtenerHelados};
